import React, { useEffect } from 'react'
import { Field, Formik } from 'formik'
import * as actions from '../../../backend/store/actions'
import { connect } from 'react-redux'
import styled from 'styled-components'
import CardReactFormContainer from 'card-react'

import { SignUpSchema } from './SignUpSchema.js'
import { StyledForm } from '../../../style/UI/FormWrappers.js'
import Button from '../../../style/UI/Buttons.js'
import { TextInput } from '../../../style/UI/Inputs.js'
import { Message, MessageWrapper } from '../../../style/UI/Message.js'
import { getCreditCardType } from '../CreditCard.js'

const AlignedWrapper = styled.div`
  width: 100%;
  display: flex;
  justify-content: space-between;

  div { width: 48% };
`

const SignUpForm = ({ signUp, cleanUp, error, loading }) => {
  useEffect(() => {
    return () => {
      cleanUp()
    }
  }, [cleanUp])

  return (
    <Formik
      initialValues = {{
        firstName: "",
        lastName: "",
        username: "",
        email: "",
        phone: "",
        passwordOne: "",
        passwordTwo: "",
        creditCard: "",
        creditCardType: "",
        expDate: "",
        secCode: "",
        apps: [false, false, false, false], // Postamtes, GrubHub, DoorDash, UberEats
      }}
      validationSchema = {SignUpSchema}
      onSubmit = {async ( values, { resetForm, setSubmitting, setFieldValue }) => {
        await signUp(values)
        resetForm()
        setSubmitting(false)
      }}
    >
      {({ values, isSubmitting, isValid }) => (
        <StyledForm>

          <AlignedWrapper>
            <Field name = "firstName" type = "text" component = {TextInput} label = "First Name"/>
            <Field name = "lastName" type = "text" component = {TextInput} label = "Last Name"/>
          </AlignedWrapper>

          <Field name = "username" type = "text" component = {TextInput} label = "Username"/>
          <Field name = "email" type = "email" component = {TextInput} label = "Email"/>
          <Field name = "phone" type = "text" component = {TextInput} label = "Phone"/>

          <AlignedWrapper>
            <Field name = "passwordOne" type = "password" component = {TextInput} label = "Password"/>
            <Field name = "passwordTwo" type = "password" component = {TextInput} label = "Confirm Password"/>
          </AlignedWrapper>

          <CardReactFormContainer
            container = "card-wrapper" // required

            // an object contain the form inputs names.
            // every input must have a unique name prop.
            formInputsNames={
              {
                number: 'CCnumber', // optional — default "number"
                expiry: 'CCexpiry',// optional — default "expiry"
                cvc: 'CCcvc', // optional — default "cvc"
                name: 'CCname' // optional - default "name"
              }
            }

            // initial values to render in the card element
            initialValues= {
              {
                number: '4242424242424242', // optional — default •••• •••• •••• ••••
                cvc: '123', // optional — default •••
                expiry: '16/12', // optional — default ••/••
                name: 'Random Name' // optional — default FULL NAME
              }
            }

            // the class name attribute to add to the input field and the corresponding part of the card element,
            // when the input is valid/invalid.
            classes={
              {
                valid: 'valid-input', // optional — default 'jp-card-valid'
                invalid: 'invalid-input' // optional — default 'jp-card-invalid'
              }
            }
          >

            <form>
              <input placeholder="Full name" type="text" name="CCname" />
              <input placeholder="Card number" type="text" name="CCnumber" />
              <input placeholder="MM/YY" type="text" name="CCexpiry" />
              <input placeholder="CVC" type="text" name="CCcvc" />
            </form>

          </CardReactFormContainer>

          <div id="card-wrapper"></div>

          {/* <Field name = "creditCardType" type = "text" component = {TextInput} value = {getCreditCardType(values.creditCard)} label = "Credit Card"/>
          <Field name = "creditCard" type = "text" component = {TextInput} label = "Card Number" /> */}
{/* 
          <AlignedWrapper>
              <Field name = "expDate" type = "text" component = {TextInput} label = "Expiration Date"/>
              <Field name = "secCode" type = "text" component = {TextInput} label = "Security Code"/>
          </AlignedWrapper> */}

          <Button
            disabled = {!isValid || isSubmitting}
            loading = {loading ? 'Creating account...' : null}
            type = "submit"
          > 
            Sign Up 
          </Button>

          <MessageWrapper>
            <Message error show = {error}>{ error }</Message>
          </MessageWrapper>

        </StyledForm>
      )}
    </Formik>
  )
}

const mapStateToProps = ({ auth }) => ({
  loading: auth.loading,
  error: auth.error,
})

const mapDispatchToProps = {
  signUp: actions.signUp,
  cleanUp: actions.clean,
}

export default connect(mapStateToProps, mapDispatchToProps)(SignUpForm)
